#include <iostream>
#include <vector>
#include <string>
#include <algorithm>

using namespace std;

const int N = 25;

int dp[N][N][N][N];

int dfs(int x, int y, int xx, int yy) {
    if (x == xx && y == yy) return 0;
    if (dp[x][y][xx][yy] != -1) return dp[x][y][xx][yy];
    int res = 1e9;
    for (int i = x; i <= xx; i++) {
        for (int j = y; j <= yy; j++) {
            if (i == x && j == y) continue;
            int tmp = dfs(i, j, xx, yy);
            if (tmp != 1e9) res = min(res, tmp + 1);
        }
    }
    return dp[x][y][xx][yy] = res;
}

int main() {
    int h, w;
    cin >> h >> w;
    vector<string> a(h);
    for (int i = 0; i < h; i++) {
        cin >> a[i];
    }
    int cnt = 0;
    for (int i = 0; i < h; i++) {
        for (int j = 0; j < w; j++) {
            if (a[i][j] == '.') cnt++;
        }
    }
    if (cnt % 2 == 1) {
        cout << "First" << endl;
    } else {
        for (int i = 0; i < h; i++) {
            for (int j = 0; j < w; j++) {
                if (a[i][j] == '.') {
                    for (int k = i; k < h; k++) {
                        for (int l = j; l < w; l++) {
                            if (a[k][l] == '.') {
                                memset(dp, -1, sizeof(dp));
                                int res = dfs(i, j, k, l);
                                if (res % 2 == 0) {
                                    cout << "First" << endl;
                                    return 0;
                                }
                            }
                        }
                    }
                }
            }
        }
        cout << "Second" << endl;
    }
    return 0;
}
